import './MainPage.css';
import React from 'react';
import Select from 'react-select';

function MainPage() {

    const SortBy = [
        { value: 'Popülerlik', label: 'Popülerlik' },
        { value: 'B', label: 'Değerlendirme' },

      ];

  return (
    <div className ="MainPageBody">
        <div className="Layout"> 
            <div class="Welcome">1</div>

            <div class="Search-Bar">
                <form  class="bar">
                    <input class="bar-field" type="search" name="search" pattern=".*\S.*" required autocomplete="off"/>
                    <button class="search-btn" type="submit">
                    <span>Ara</span>
                    </button>
                </form>
                </div>


            <div class="Sort-And-Filter">
            <Select options={SortBy} />
            </div>
            <div class="Universities-Container">4</div>
        </div>
    </div>
  );    
}

export default MainPage;
